#include "stdlib.h"
#include "stdio.h"



void swap(int *a, int *b){
    int tmp = *b;
    *b = *a;
    *a = tmp;
    return; 
}

void quick_sort(int *arr, int h, int t) {
    if (h >= t) return;

    int flag = arr[h];
    int i = h+1;
    int j = t;
    while(i < j) {
        while(arr[i] <= flag && i<=j) i++;
        while(arr[j] >= flag && j>=i) j--;
        if (i < j) swap(&arr[i], &arr[j]);
    }
    swap(&arr[h], &arr[i]);

    quick_sort(arr, h, j - 1);
    quick_sort(arr, j+1, t);
    return;
}

/*time outed for leetcode*/
int majorityElement_qkst(int* nums, int numsSize) {
    quick_sort(nums, 0, numsSize-1);
    return nums[numsSize/2];
}

int majorityElement(int* nums, int numsSize) {
    int condidate;
    int count = 0;
    for (int i = 0; i < numsSize; ++i)
    {
        if (count == 0)
        {
            condidate = nums[i];
            count = 1;
        }
        else if (nums[i] == condidate)
        {
            count++;
        }
        else {
            count--;
        }    
    }
    return condidate; 
}

